- input: "TEXT\x1CC00508002\x1C.TEXT\x1C\x1CF3XA\x1CThis report includes resulting
    changes from amendments to an earlier report AND response to the RFAI dated March
    8, 2013.  In response to question 1, this committee has corrected the transactions
    at issue.  In response to question 2, the committee believes these transactions
    were originally included in other 24-hour reports, but that the subsequent amendment
    and re-allocation of all prior 24-hour reports requested by the Commission resulted
    in a number of \"orphan\" transactions after the fact.  In response to question
    3, the transaction for $40,971.00 does not appear in our .dcf file, and may have
    been part of an earlier report that was subsequently amended.  The transaction
    dated on 3/7/12 occurred less than two day prior to the primary, and thus would
    not be included in the calculation of a 24-hour report, but that the committee
    believes should still be reported on line 24.\n"
